// types
import { Feature } from './types';

const features: Feature[] = [
    {
        deviceIcon: 'monitor',
        deviceName: 'Windows',
    },
    {
        deviceIcon: 'airplay',
        deviceName: 'Mac',
    },
    {
        deviceIcon: 'server',
        deviceName: 'Browser',
    },
    {
        deviceIcon: 'smartphone',
        deviceName: 'Mobile',
    },
];

export { features };
